import React from 'react'
import Header from "./components/Header";
import Footer from "./components/Footer";
// import Todoitems from "./components/Todoitems";
import Todos from "./components/Todos";
export default function App() {

  const tonda = [
    {
      slno : 1,
      title : 'Go to Market',
      desc : 'Going to market and coming is the job 11'
    },{
      slno : 2,
      title : 'Go to Mall',
      desc : 'Going to Mall and coming is the job 12'
    },{
      slno : 3,
      title : 'Go to Station',
      desc : 'Going to Station and coming is the job 13'
    },{
      slno : 4,
      title : 'Go to park',
      desc : 'Going to park and coming is the job 14'
    },
  ]
  return (
    <div>
      {/* <Header title={45} searchBar={true} />  // Warning: Failed prop type: Invalid prop `title` of type `number` supplied to `Header`, expected `string`. because of propType in header */}
      {/* <Header searchBar={true} /> //for default props in header if title prop not given default will be loaded */}
      {/* <Header title='My Todos List' //react-dom.development.js:86 Warning: Failed prop type: The prop `searchBar` is marked as required in `Header`, but its value is `undefined`. /> */}
      <Header title='My Todos List' searchBar={false} />
      <Todos todos={tonda}/>
      <Footer/>
    </div>
  )
}
